pub fn num_shares_vs_time_experiment(allocator: std.mem.Allocator) !void {
    var prime = try Managed.init(allocator);
    try prime.setString(16, "fffffffffffffffffffffffffffffffffffffffffffffffffffffffefffffc2f");

    var two = try Managed.initSet(allocator, 2);
    var secret = try Managed.init(allocator);
    var r = try Managed.init(allocator);
    try Managed.divFloor(&secret, &r, &prime, &two);

    var n_shares: usize = 2;
    while (n_shares < 100) : (n_shares += 1) {
        const t = try time(allocator, n_shares - 1, n_shares, prime, secret);
        try stdout.print("{d}, {d}\n", .{ n_shares, t });
    }

    secret.deinit();
    prime.deinit();
    two.deinit();
    r.deinit();
}

